	(321, 24, 502, '1314', '2019-03-21T02:34:00.000Z', '11:29', '12:20', '0:51', '45 minutes', '20', 'Not Set', 'Not Set', 'Checked in vehicle. No spare whipper motors for Coffeetek equipment. Signed into site and walked to machine. Flushed. Whipper motor struggling. Isolated power and swapped with unused whipper motor. Refurbished the other 2 whippers and lubed seals and o rings. Audited and tested the machine.<div><br></div><div>***. Studio. Serial No:EM7007. ******</div>', NULL, 1, 1, 1, NULL, 1, NULL, 65, 24, NULL, '2019-03-21 07:39:11', '2019-03-26 07:40:14'),
	(322, 86, 510, '1315', '2019-03-21T03:32:00.000Z', '08:30', '13:30', '5 hrs', NULL, NULL, NULL, NULL, '<div>Ketan</div><div><br></div><div>Refurb machine, machine dirty, washed and dried, glue stuck on all panels(removed), test run machine.</div><div><br></div><div>Parts : w seal - 1, nozzle holder - 1, RL spout - 1, w tank - 1<br></div>', NULL, 1, 1, NULL, NULL, 1, NULL, 86, NULL, NULL, '2019-03-21 08:34:48', '2019-03-21 08:34:48'),
	(323, 79, 492, '1314', '2019-03-20T23:00:00.000Z', '12:00', '13:30', '1:30', '45 mins', '23', NULL, NULL, 'Graham<div>-Call to site check out location</div><div>-Drill hole in bench top for water hose through joinery, make up extra hose to reach water connection.</div><div>-Connect up</div><div>-Test water , place filter</div><div>-Fill and heat machine</div><div>-taste test with staff</div><div>-Demo cleaning&nbsp;</div><div>-Tidy up</div><div>-All Ok</div><div><br></div>', NULL, 1, 1, NULL, NULL, 1, NULL, 79, NULL, NULL, '2019-03-22 02:29:00', '2019-03-22 02:29:00'),
	(324, 79, 486, '1314', '2019-03-21T19:55:00.000Z', '08:55', '09:20', '0:25', '20 mins', NULL, NULL, NULL, 'Mark<div>-Arrived on site, checked machine and found to be clean.</div><div>-Removed all parts and checked, found canister spouts jammed in causing product to fall out.</div><div>-Showed customer on how to clean</div><div>-test machine operation, tested all ok</div>', NULL, 1, 1, NULL, NULL, 1, NULL, 79, NULL, NULL, '2019-03-22 02:57:33', '2019-03-22 02:57:33'),
	(325, 79, 490, '1314', '2019-03-20T01:30:00.000Z', '14:30', '15:20', '0:50', '30 mins', NULL, NULL, NULL, 'Meghal Patel<div>-Extract the coffee machine and filter.</div><div>-Drain water out</div><div>-took both door keys and put in canister</div><div>-Remove all powder and beans from machine.&nbsp;</div>', NULL, NULL, NULL, NULL, NULL, 1, NULL, 79, NULL, NULL, '2019-03-22 02:59:49', '2019-03-22 02:59:49'),
	(326, 86, 509, '1314', '2019-03-21T22:01:00.000Z', '08:45', '09:50', '60 minutes', '60 minutes', '64 kms', NULL, NULL, '<div>Ketan</div><div><br></div><div>Arrived on site, parking, walk to machine. open and check fault. move the machine away from bench(not enough space). check element(faulty) and replaced. Run the machine. checked SSR. wait for temperature. made all drink. rewrite the sugar button programming(was incorrect). <br></div><div>Move the other machine on site to wipe bench. checked the other machine operation. place and plug it back everything. make sure both machines are operating. other machine sr no. 20153732038. CC - 35433</div><div><br></div><div>Setup time - 10 minutes.</div><div>Parts - Element - 1<br></div>', NULL, 1, 1, 1, NULL, 1, NULL, 86, NULL, NULL, '2019-03-22 03:09:58', '2019-03-22 03:09:58'),
