	(382, 150, 563, '1314', '2019-03-27T00:52:00.000Z', '11:30', '13:00', '90 minutes', '60 minutes', '50 kms', NULL, NULL, '<div>Ketan</div><div><br></div><div>Installation and extraction. Arrived on site, parking, sign in, locate the machine. disconnect and remove old plumbing. install all new plumbing. Two machines supplied by C50 filter. Install the machine. checked all drinks.</div><div><br></div><div>Setup time : 30 minutes</div><div>Parking Paid - $18.50<br></div>', NULL, 1, 1, 1, 'Receptionist', 1, NULL, 150, NULL, NULL, '2019-03-27 14:01:21', '2019-03-27 14:01:21'),
	(383, 150, 569, '1314', '2019-03-27T03:01:00.000Z', '14:15', '14:40', '25 minutes', '20 minutes', '6 kms', NULL, NULL, '<div>Ketan</div><div><br></div><div>Arrived on site, parking, walk to machine. check fault. no lights flashing on machine. customer said water, temperature lights comes up and goes off after a while. flush machine 4 to 5 times. no lights. check water pressure(low). empty half water tank and notice the water level on tank(filling up slowly). replace inlet valve. check water level on tank again(filling up a bit faster than previous but not fast enough). explain this to customer. sign off.</div><div><br></div><div>Parts used - Inlet valve - 1<br></div>', NULL, 1, 1, 1, 'Ajeshni', 1, NULL, 150, NULL, NULL, '2019-03-27 16:09:03', '2019-03-27 16:09:03'),
