	(385, 151, 562, '1315', '2019-03-27T21:32:00.000Z', '09:00', '15:00', '6:0', NULL, NULL, NULL, NULL, 'refurb , repair and set up<div><br></div><div><div>open and descaled the boiler,&nbsp; removed all canisters and other parts,washed all parts,&nbsp; wiped out the whole machine in and out</div><div>refurbed all electric parts(wipper motors, fans),&nbsp; refitted everything ,run and program machine</div><div>checked drinks level (std. set up),&nbsp; test and tag, drain boiler,&nbsp; machine ready for placement.</div></div><div><br></div><div>Extra repair work&nbsp; and parts used:</div><div>3 wipper seal , 1 LL spout</div><div>painted front rusty panel</div><div>fix door problem, relabelled all canister&nbsp;</div>', NULL, 1, 1, NULL, NULL, 1, NULL, 151, NULL, NULL, '2019-03-28 10:36:09', '2019-03-28 10:36:09'),
