	(419, 151, 613, '1314', '2019-04-03T03:02:00.000Z', '11:00', '15:00', '4:0', '1hr 15 minutes', '54 kms', 'Not Set', 'Not Set', 'Sandip and Ketan<div><br></div><div>Installation.&nbsp;</div><div>Two site installation together with sandio.</div><div>Arrived on site, parking walk to machine. extracted v cafe. install new filter. change lead. run machine and check levels. remove filter, prv and check levels. taste test with customer. sign off.</div><div><br></div><div>Note : On site machine has 32A TP power pint but machine is actually running on 16A SP from the TP power supply.</div><div>No filter and prv.</div><div><br></div><div>Setup time - 2Hrs (paarking,setup,drink level check,errors)</div>', NULL, 1, 1, 1, 'Roshan', 1, NULL, 150, 151, NULL, '2019-04-03 16:11:56', '2019-04-03 16:21:29'),
