	(458, 79, 593, '1314', '2019-04-01T03:30:00.000Z', '16:30', '17:25', '0:55', '25', NULL, NULL, NULL, 'Frank<div>-Grinder not working</div><div>-Remove grinder and find motor part from grinder</div><div>-replace grinder</div><div>-test ok</div><div><br></div><div>parts used</div><div>1 grinder</div>', NULL, NULL, NULL, NULL, NULL, 1, NULL, 79, NULL, NULL, '2019-04-10 15:52:34', '2019-04-10 15:52:34'),
	(459, 79, 649, '1314', '2019-04-09T02:00:00.000Z', '14:00', '15:25', '1:25', '60', '50', NULL, NULL, 'Peter<div>-Changed water pump, after pump change no milk powder was being dispensed.</div><div>-then no choc</div><div>-Kept testing until came right</div>', NULL, NULL, NULL, NULL, 'Claire Gravatt', 1, NULL, 79, NULL, NULL, '2019-04-10 15:56:43', '2019-04-10 15:56:43'),
	(460, 79, 628, '1314', '2019-04-04T21:10:00.000Z', '10:10', '10:25', '0:15', '20', NULL, NULL, NULL, 'Mark<div>-Arrived on site, found customer using the wrong type of choc</div><div>-Spoke with Paul who advised not to make any changes</div><div>-Ordered new drip tray as one in machine is damaged.</div><div>NOTe- customer using Nestle 1 kg spoon to cup also found customer using Nestle Classic Tin and not vending classic&nbsp;</div>', NULL, NULL, NULL, NULL, 'Allioon Dornan', 1, NULL, 79, NULL, NULL, '2019-04-11 09:12:24', '2019-04-11 09:12:24'),
	(461, 152, 648, '1314', '2019-04-08T03:00:00.000Z', '15:00', '15:45', '0:45', '30', '25', NULL, NULL, 'test run machine, faulty pump<div>replace pump and test run. water leaking from back, refit pump and boiler again and no leak found.</div><div>Machine dirty and customer required training on machine.</div><div>show customer how to pull out all part and clean.&nbsp;</div><div>found mixing bowl broken, replace part.</div><div>drink test and flushed OK</div><div>taking cup count.</div>', NULL, 1, 1, 1, 'Liz', 1, NULL, 152, NULL, NULL, '2019-04-11 09:35:58', '2019-04-11 09:35:58'),
	(462, 79, 553, '1314', '2019-03-31T21:40:00.000Z', '10:40', '12:45', '3.40', '30', '31', 'Not Set', 'Not Set', 'Kevin Hillier<div><br></div><div>trip 1</div><div><br><div>-Disconnected and drained machine</div><div>-removed , installed new filter</div><div>-Flushed, filled heated</div><div>-water pressure too low</div><div>-found feed from hot water, need to change</div><div>-Left</div></div><div><br></div><div>trip 2</div><div>connected filter and water heated</div><div>-Attempted to fill 5L, no joy</div><div>-Removed filter tried again, tested Ok</div><div>-had to to to bunnings for adapter and plug&nbsp;</div><div><br></div><div>parts used</div><div>1 plug&nbsp;</div><div>1 20 to 15 adapter</div>', NULL, NULL, NULL, NULL, NULL, 1, NULL, 79, 79, NULL, '2019-04-11 09:44:09', '2019-04-17 10:02:51'),
	(463, 79, 575, '1314', '2019-03-31T23:45:00.000Z', '12:45', '13:15', '0:30', '15', NULL, NULL, NULL, 'Kevin Hillier<div>-Lowered coffee in all drinks</div><div>-tested Ok</div>', NULL, NULL, NULL, NULL, 'Tracee', 1, NULL, 79, NULL, NULL, '2019-04-11 09:46:59', '2019-04-11 09:46:59'),
	(464, 79, 574, '1314', '2019-04-03T22:20:00.000Z', '11:20', '11:35', '0:15', '15', NULL, NULL, NULL, 'Kevin Hillier<div>-Drain removed from OfficeMax</div>', NULL, NULL, NULL, NULL, 'Gavin', 1, NULL, 79, NULL, NULL, '2019-04-11 09:50:37', '2019-04-11 09:50:37'),
	(465, 152, 671, '1314', '2019-04-09T00:00:00.000Z', '12:00', '12:15', '0:15', '15', '10', NULL, NULL, 'test run machine. no water coming out on second mixing bowl<div>spoken to customer and decided remove machine from site because of the low cup counts</div><div>empty water and taking machine away</div><div><br></div><div>machine wont go back to site.</div>', NULL, NULL, 1, NULL, 'Karen', 1, NULL, 152, NULL, NULL, '2019-04-11 09:59:45', '2019-04-11 09:59:45'),
	(466, 152, 669, '1314', '2019-04-09T00:00:00.000Z', '12:30', '13:00', '0:30', '30', '20', NULL, NULL, 'test run machine. no fault or leak found.<div>spoke to customer. OFF3 only shows after done cleaning and flushed.</div><div>explain to customer that is normal and just need to empty drip tray and reset machine.</div><div>also customer said no bean error shows sometimes after drink made,</div><div>adjust grinder and test OK</div><div>drink test and flushed OK</div><div>taking cup count.</div>', NULL, 1, 1, 1, 'Gary', 1, NULL, 152, NULL, NULL, '2019-04-11 10:29:54', '2019-04-11 10:29:54'),
	(467, 152, 670, '1314', '2019-04-08T23:30:00.000Z', '11:30', '12:00', '0:30', '45', '25', NULL, NULL, 'test run machine.&nbsp;<div>ring back to workshop check for products config and&nbsp;<span style="color: inherit; font-family: inherit; font-size: 0.875rem;">found customer using wrong products</span></div><div><div>customer using Moccona coffee and Hot chocolate rich and creamy.</div><div>shows customer what products they should be using. (Nescafe Classic and Hot Chocolate complete mix.)</div></div><div>told customer ring us back once they got the correct products.</div><div>taking cup count</div>', NULL, 1, 1, 1, 'Vaha', 1, NULL, 152, NULL, NULL, '2019-04-11 10:36:36', '2019-04-11 10:36:36'),
	(468, 151, 675, '1314', '2019-04-11T01:15:00.000Z', '11:00', '12:00', '1:0', '45 minutes', '26 kms', '30 minutes', 'contact person and security check up', '30 minutes( find out parking, security check up, wait for contact person, walk to machine)<div>turn on machine, making too much noise, open back panel and replace fan, band back panel little bit, fitted, working fine, made some drinks, changed incorrect spout, explained customer, sign off</div>', NULL, NULL, NULL, NULL, 'Tracey', 1, NULL, 151, 151, NULL, '2019-04-11 13:19:34', '2019-04-16 15:15:18'),
	(469, 65, 677, '1314', '2019-04-11T02:55:00.000Z', '12:30', '13:15', '0:45', '45 minutes', '20', '10 minutes', 'Getting access to site', '<div>Due to recent events, security has been stepped up, so a bit of a delay getting access to site.&nbsp;&nbsp; Inspected machine. Machine looks clean. Test vended mocha. Bowl looks like it is not quite clearing during vend cycle. Tweaked the program to adjust start times of milk and choc product, and increased water time slightly. Extraction fan a bit noisy. Isolated power and cleaned fan. Refitted and electrically safety tested. All ok. Flushed water pumps. Boiler may need a descale in the next few months, but did not have solution on me to carry out operation. Tested the machine. All working much better. Audited the machine.</div><div><br></div><div>**** Alegria 8-60&nbsp; Serial No:20154438387&nbsp; ****<br></div>', NULL, 1, 1, 1, 'Phil', 1, NULL, 65, NULL, NULL, '2019-04-11 15:01:30', '2019-04-11 15:01:30'),
	(470, 152, 678, '1314', '2019-04-11T03:15:00.000Z', '15:15', '15:35', '0:15', '150', '70', 'Not Set', 'Not Set', 'Test run machine.&nbsp;<div>Brewer leaking. Replace brewer and test OK.&nbsp;</div><div>Drink test and flushed ok.&nbsp;</div><div>Taking cup count.</div><div><br></div><div>Also went to other 3 sites to adjust setting for Grandezza.</div>', NULL, 1, 1, 1, 'Chris', 1, NULL, 152, 152, NULL, '2019-04-11 15:25:43', '2019-04-15 09:30:51'),
	(471, 150, 686, '1315', '2019-04-10T21:45:00.000Z', '08:30', '15:00', '6 hrs 30 minutes', NULL, NULL, NULL, NULL, '<div>Ketan</div><div><br></div><div>Refurbish machine. machine is too dirty. washed all panels, doors, whole machine body. replace whole button panel. descale boiler. wipe whole machine. remove glue from the panels. washed all canisters and other parts. serviced all electric parts. run, program machine. checked drinks, tested machine.</div><div><br></div><div>Parts used :</div><div>button panel(old) - 1, w seal - 2, w blade - 2, w motor - 1,Drip tray - 1, SS nozzle holder - 1, coffee pipe - 1, water pipe - 1<br></div>', NULL, 1, NULL, NULL, NULL, 1, NULL, 150, NULL, NULL, '2019-04-12 09:51:22', '2019-04-12 09:51:22'),
	(472, 151, 681, '1315', '2019-04-11T22:20:00.000Z', '09:00', '10:15', '1:15', NULL, NULL, NULL, NULL, 'standard set up<div>plugged and run it, checked drinks levels, adjust for few drinks, replace 1 drip tray, drain boiler tank, packed for site</div>', NULL, 1, 1, NULL, NULL, 1, NULL, 151, NULL, NULL, '2019-04-12 10:22:14', '2019-04-12 10:22:14'),
	(473, 151, 651, '1315', '2019-04-12T00:26:00.000Z', '10:00', '11:35', '1:30', NULL, NULL, NULL, NULL, 'special set up<div>plugged in and run it, put new label&nbsp; for latte drinks, change programming, checked drinks level, adjusted drinks level, drain boiler , packed machine</div>', NULL, 1, 1, NULL, NULL, 1, NULL, 151, NULL, NULL, '2019-04-12 10:31:44', '2019-04-12 10:31:44'),
	(474, 65, 688, '1314', '2019-04-12T00:10:00.000Z', '12:10', '13:15', '1:5', '45 minutes', '20km', NULL, NULL, 'Switched on machine. Water pouring out of overflow pipe. Isolated water and power. Removed level probes. Cleaned and refitted. Checked inlet solenoid. All ok. Cleaned pumps and outlets. Electrically safety tested the machine. All ok. Switched on and removed pump restrictors. Flushed pumps. Waited for machine to heat up. Tested. Much better. Audited the machine', NULL, 1, 1, 1, 'Maryann', 1, NULL, 65, NULL, NULL, '2019-04-15 12:29:53', '2019-04-15 12:29:53'),
	(475, 65, 689, '1314', '2019-04-12T02:00:00.000Z', '14:00', '14:45', '0:45', '45 minutes', '20 km', NULL, NULL, 'Signed into site. No contact person on paperwork. Went to area. No sign of machine. Found Rory in factory. He could not get ahold of Simon, the chief engineer. Walked around factory until we found the machine. Drained the boiler. Machine has been cleaned, but parts in a box. Checked parts. All accounted for except door key. Loaded machine into vehicle and removed from site', NULL, NULL, NULL, NULL, 'Rory', 1, NULL, 65, NULL, NULL, '2019-04-15 12:50:07', '2019-04-15 12:50:07'),
	(476, 65, 697, '1314', '2019-04-14T22:30:00.000Z', '10:30', '11:35', '1', '45 minutes', '20km', NULL, NULL, 'Isolated water and power. Turned machine around. Removed boiler and inlet solenoid. Descaled boiler, level probes and pumps. Cleared mechanical lock on inlet solenoid. Removed fan and duct. Cleared extraction system in rear of machine. Removed canisters and whipper Systems. Removed front extraction housing. Washed, dried and refitted housing and extraction drawers. Refitted dispense head and whipper bowls. Electrically safety tested the machine. All ok. Switched on and flushed pumps. Refitted restrictors and back panel. Placed machine and waited for the machine to heat up. Checked product on site. Site using Gold Blend in the machine. Went over cleaning and filling of the machine with site, since no longer looked after by cafe staff. Tested machine. Much better', NULL, 1, 1, 1, 'Michelle', 1, NULL, 65, NULL, NULL, '2019-04-15 12:58:29', '2019-04-15 12:58:29'),
	(477, 151, 690, '1315', '2019-04-15T01:44:00.000Z', '11:00', '13:00', '2:0', NULL, NULL, NULL, NULL, 'standard set up,&nbsp;<div>run machine, assign BMB sticker, blocked small inlet pipe, programmed ,machine, labelled canisters and drinks menu, checked drinks level, adjusted level, test and tag, drain boiler, machine ready</div>', NULL, 1, 1, NULL, NULL, 1, NULL, 151, NULL, NULL, '2019-04-15 13:47:05', '2019-04-15 13:47:05'),
	(478, 150, 703, '1314', '2019-04-15T03:23:00.000Z', '13:25', '13:45', '20 minutes', '25 minutes', '18 kms', NULL, NULL, '<div>Ketan</div><div><br></div><div>Arrived on site, parking, walk to machine, open check fault, switch behind machine was off, turn it on, wait for temperature, made drinks, informed customer about this, sign off<br></div>', NULL, 1, 1, 1, 'Alwyn', 1, NULL, 150, NULL, NULL, '2019-04-15 15:27:32', '2019-04-15 15:27:32'),
	(479, 150, 704, '1314', '2019-04-15T03:52:00.000Z', '14:05', '14:35', '30 minutes', '45 minutes', '28 kms', 'Not Set', 'Not Set', '<div>Ketan</div><div><br></div><div>Arrived on site, parking, sign in, \nwalk to machine, open and check fault, machine clean but milk m bowl \nclogged badly, remove spout, m bowl, steam tray and wash them up, found \ncoffee bean stuck in nozzle, remove and cleaned it, explain this to \ncustomer, made all drink, sign off.</div><div><br></div>Setup time : 10 minutes', NULL, 1, 1, 1, 'Rinnie', 1, NULL, 150, 150, NULL, '2019-04-15 15:52:45', '2019-04-15 15:55:54'),
	(480, 150, 712, '1315', '2019-04-14T22:42:00.000Z', '08:30', '13:35', '5:5', NULL, NULL, NULL, NULL, '<div>Ketan</div><div><br></div><div>Descale and wash boiler, washed all canisters and parts, serviced all electrical parts, wipe the whole machine, removed glue stuck on panel, run program machine, check drinks, tested machine, empty boiler.</div><div><br></div><div>Parts used :</div><div>w seal - 3, w blade - 3, SS nozzle holder - 1, Drip tray + grate - 1, LL Spout - 1, RS spout - 1, coffee pipe - 1, mixer insert ring - 1.<br></div>', NULL, 1, 1, 0, NULL, 1, NULL, 150, NULL, NULL, '2019-04-16 10:53:09', '2019-04-16 10:53:09'),
	(481, 65, 711, '1314', '2019-04-15T23:52:00.000Z', '11:35', '12:15', '0:40', '45', '20', NULL, NULL, 'Inserted door key. Phoned Nestle and gave Christina the cup count. Spoke with Bruce. He made a choc drink. Noise coming from whipper motor. Broken clip. Spoke with Nestle. Paul leaving machine, but if it breaks down, it will be removed. Advised Bruce. Took cup count of Algeria 8 60.<div><br></div><div>Rhea Mini S/N:6410923</div>', NULL, 1, 1, 1, 'Bruce', 1, NULL, 65, NULL, NULL, '2019-04-16 12:04:10', '2019-04-16 12:04:10'),
	(482, 151, 709, '1314', '2019-04-16T01:12:00.000Z', '10:45', '12:00', '1:15', '60 minutes', '46', '30', 'contact person', 'arrived onsite, wait for contact person to come&nbsp; (30 minutes set up time = waiting and security check up)<div>open and inspect machine, no augur motor for choc canister, open back and replace broken augur motor, put it back and made some drinks, working fine now, went to car to take spout , replace broken spout, sign off</div><div><br></div><div><br></div><div><br></div><div>parts: 1*augur motor, 2* spout</div>', NULL, 1, NULL, NULL, 'miri', 1, NULL, 151, 151, NULL, '2019-04-16 13:19:15', '2019-04-16 14:29:24'),
	(483, 65, 713, '1314', '2019-04-16T01:04:00.000Z', '12:40', '13:25', '0:45', '45 minutes', '20km', 'Not Set', 'Not Set', 'Flushed machine. No water on soup. Isolated power. Removed back panel and inspected. Pump seized. No spare in vehicle. Swapped pipe and wiring with hot water. Electrically safety tested. All ok. Tested. All ok. Adjusted program for hot milk option, since no hot water bi pass. Adjusted black coffee drink as well. Audited the machine', NULL, 1, 1, 1, 'Kelly', 1, NULL, 65, 65, NULL, '2019-04-16 13:23:49', '2019-04-16 13:37:16'),
	(484, 150, 714, '1314', '2019-04-16T14:21:00.000+12:00', '13:30', '14:00', '30 minutes', '30 minutes', '20 kms', '10 minutes', 'Setup', 'Arrived on site, parking, sign in, walk to machine, check fault, steam fan noisy, move machine, remove back panel, check and clean fan, position the panel in a way that it wont make any noise, run the machine, made all drinks, sign off.<br>', NULL, 1, 1, 1, 'Sophie', 1, NULL, 150, NULL, NULL, '2019-04-16 14:25:11', '2019-04-16 14:25:11'),
	(485, 79, 715, '1314', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Closed as NO COST', NULL, NULL, NULL, NULL, NULL, 1, NULL, 79, NULL, NULL, '2019-04-16 14:28:47', '2019-04-16 14:28:47'),
	(486, 65, 719, '1314', '2019-04-16T03:14:00.000Z', '14:10', '14:50', '0:40', '45 minutes', '20km', NULL, NULL, 'Fault logged against wrong machine. Advised Christina. Isolated power. Removed fan and duct. Cleaned and refitted. Electrically safety tested the machine. All ok. Switched on machine. Much quieter. Audited the machine.<div><br></div><div>NB. Machine is nearly 15 mins walk away from nearest available car park.</div><div><br></div><div>Algeria 8-120. S/N:2015436847</div>', NULL, 1, 1, 1, 'Arthur', 1, NULL, 65, NULL, NULL, '2019-04-16 15:18:42', '2019-04-16 15:18:42'),
	(487, 79, 622, '1314', '2019-04-04T08:45:00.000+13:00', '08:45', '10:35', '1:50', '30', NULL, NULL, NULL, 'Meghal Patel<div><br></div><div>-traveled to site, inspect location of installation, install filter.</div><div>-added one coupler to intake side of filter as input water pipe is smaller than filter input side.</div><div>-So traveled back to workshop to grd B "FMP350" from work kit , I have used only one coupler.</div><div>-hen installed new "Alegria 6-30"</div><div>-Filled out products, turn on&nbsp;</div><div>-Tested and check for leak, but all Ok</div><div>-Peter was there to try coffee and I have explained about cleaning cycle</div><div>-Finish paper work at site, took a cup count.</div><div><br></div><div><br></div><div><br></div>', NULL, NULL, NULL, NULL, NULL, 1, NULL, 79, NULL, NULL, '2019-04-17 08:40:50', '2019-04-17 08:40:50'),
	(488, 150, 705, '1315', '2019-04-16T09:00:00.000+12:00', '08:30', '09:45', '75 minutes', NULL, NULL, NULL, NULL, '<div>Setup machine</div><div>Standard setup with soup option. hot water instead of black coffee and soup instead of hot water button.<br></div>', NULL, 1, 1, NULL, NULL, 1, NULL, 150, NULL, NULL, '2019-04-17 09:02:45', '2019-04-17 09:02:45'),
	(489, 79, 407, '1314', '2019-04-05T09:54:00.000+13:00', '13:00', '16:00', '3:0', '30', NULL, NULL, NULL, 'Pete<div>3 trips (Nestle will not pay for the 1st trip)</div><div><br></div><div>trip 1 27/03/19</div><div><span style="color: inherit; font-family: inherit; font-size: 0.875rem;">no pump on site</span></div><div><br></div><div>trip 2 04/04/19</div><div>Disassembled and test.</div><div>-part on order. Wrong part sent</div><div><br></div><div>trip 3 05/04/19</div><div>Re attend and replace motor / pump</div><div>-remove and clean, all canisters and replace all products causing blockages on hoppers 1, 2 and 3</div><div><br></div>', NULL, NULL, NULL, NULL, NULL, 1, NULL, 79, NULL, NULL, '2019-04-17 09:57:40', '2019-04-17 09:57:40'),
	(490, 79, 683, '1314', '2019-04-12T10:00:00.000+12:00', '10:00', '10:45', '0:45', '15', NULL, NULL, NULL, 'Kevin Hillier<div><br></div><div>Programmed machine and tested ok</div><div>-Filled up 2.5 L twice</div><div>-tested Ok</div>', NULL, NULL, NULL, NULL, NULL, 1, NULL, 79, NULL, NULL, '2019-04-17 10:04:18', '2019-04-17 10:04:18'),
	(491, 79, 581, '1314', '2019-04-26T10:04:00.000+12:00', '10:30', '18:35', '8:5', '50', NULL, NULL, NULL, 'Graham<div>Day 1</div><div>26 /03/19</div><div><br></div><div>Receive material , unpack and distribute to skyline and Ryders. Collect nitrogen cylinder from BOC</div><div><br></div><div>Day 2&nbsp;</div><div>28/03/19</div><div>Receive and unpack pallet from Australia and Auckland</div><div>-Start moving equipment to Ryders.</div><div><br></div><div>Day 3</div><div>29/03/19</div><div>Move rest of equipment to Ryders setup. Connect up water to Ryders set up</div><div>-Connect up water and power . Fill with product and test all expect Nitro machine.</div><div><br></div><div>Day 4</div><div>04/04/19</div><div><br></div><div>Retrieve all equipment from hotel pack up on 2 pallets ad wrap.</div><div>_returned Nitrogen Cylinders</div>', NULL, NULL, NULL, NULL, NULL, 1, NULL, 79, NULL, NULL, '2019-04-17 10:30:21', '2019-04-17 10:30:21'),
	(492, 79, 687, '1314', '2019-04-17T09:50:00.000+12:00', '09:51', '10:15', '0:24', '36', '35', NULL, NULL, 'Mark<div>-Arrived on site, removed the faulty pump and replaced with new.</div><div>-Reassembled and tested machine, tested all OK</div><div><br></div><div>parts used</div><div>1 pump</div>', NULL, NULL, NULL, NULL, NULL, 1, NULL, 79, NULL, NULL, '2019-04-17 11:47:18', '2019-04-17 11:47:18'),
