	(524, 65, 723, '1314', '2019-04-17T09:10:00.000+12:00', '09:10', '10:00', '0:50', '45 minutes', '20', NULL, NULL, 'Checked milk canister. Teeth on agitator wheel worn down, so canister oscillates rather than dispenses. Noted slight drip on boiler overflow. Checked in rear. Boiler not overfilling, but suspect slight drip on inlet solenoid. Ordered replacement solenoid, so that can fit before 4 day weekend. Audited the machine and electrically safety tested. All ok', NULL, 1, 1, 1, 'Michelle', 1, NULL, 65, NULL, NULL, '2019-04-18 15:07:01', '2019-04-18 15:07:01'),
	(525, 65, 733, NULL, '2019-04-18T15:07:00.000+12:00', '08:00', '09:15', '1:15', NULL, NULL, NULL, NULL, 'Isolated water and power. Turned machine around. Disconnected fan plate and boiler pipes. Removed boiler and drained. Confirmed element is open circuit. Replaced element, descaled pumps and refitted boiler. Cleaned exhaust fan and refitted. Electrically safety tested the machine. All ok. Switched on and tested. All ok. Waited for machine to heat up. Tested operation. All working fine. Audited the machine.<div>Algeria 8 -120 S/N:20164235771.</div>', NULL, 1, 1, 1, 'Catherine', 1, NULL, 65, NULL, NULL, '2019-04-18 15:12:39', '2019-04-18 15:12:39'),
	(526, 65, 734, '1314', '2019-04-18T15:13:00.000+12:00', '09:15', '09:45', '0:30', '45 minutes', NULL, NULL, NULL, 'Isolated power. Turned machine around. Cleaned fan and exhaust duct in rear. Removed canisters, extraction drawers and whipper bowls. Removed front extraction housing. Cleaned, dried and refitted. Electrically safety tested. All ok. Switched on tested the machine. All ok. Audited the machine.<div>Algeria 8-120. S/N:20164235773.</div>', NULL, 1, 1, 1, 'Catherine', 1, NULL, 65, NULL, NULL, '2019-04-18 15:16:30', '2019-04-18 15:16:30'),
