	(568, 150, 787, '1315', '2019-04-29T11:25:00.000+12:00', '08:30', '13:35', '5 hrs', 'Not Set', 'Not Set', 'Not Set', 'Not Set', '<div>Refurbish machine, open and descale boiler, washed all parts, canisters, serviced all electrical parts, wipe whole machine in/out, run program machine, check all drinks, tested machine, empty boiler.</div><div>Note : Machine has both square fans.<br></div><div><br></div><div>Parts:</div><div>W seal - 3, W blade - 3, Drip tray + grate - 1, inlet valve - 1, choc canister complete - 1, large canister only - 1,<br></div>', NULL, 1, 1, NULL, NULL, 1, NULL, 150, 150, NULL, '2019-04-30 11:30:43', '2019-04-30 11:37:40'),
