	(579, 65, 798, '1314', '2019-05-01T16:28:00.000+12:00', '14:55', '16:25', '1:30', '45 mins', '20', NULL, NULL, 'Attended in the morning. Pump corroded. Went back to workshop and got a spare fitted. Machine flushes coffee, then stalls. Removed tank and boiler unit. Valve corroded. Replaced valve. Cleaned power board that connects to valve. Machine still not working. Board is knackered. Discussed with Paul. We are going to pull both 8-40 machines and install 8-60. Simon to provide machine details and photograph machine on site. Will sort paperwork retrospectively&nbsp;', NULL, NULL, NULL, NULL, 'Vicenta', 1, NULL, 65, NULL, NULL, '2019-05-01 16:34:01', '2019-05-01 16:34:01'),
	(580, 151, 805, '1315', '2019-05-02T10:23:00.000+12:00', '09:00', '14:35', '5:30', NULL, NULL, NULL, NULL, 'Refurb, repair, and special set up (very dirty machine)<div><br><div><div>open and descaled the boiler, removed all canisters and other parts, washed all parts, wiped out the whole machine in and out, remove sticker and glew, washed both side panels</div><div>refurbed all electric parts(wipper motors, fans), refitted everything , run and program machine, changed programming , increase scalling factor by 15%,</div><div>checked drinks level, test and tag, drain boiler, machine ready for placement.</div></div></div><div><br></div><div>parts used:</div><div>refurb one nozzel holder , replace 3=wipper blade and wipper seal , 1= silicon coffee pipe, 2=large spout, 1= small augur,&nbsp;</div>', NULL, 1, 1, NULL, NULL, 1, NULL, 151, NULL, NULL, '2019-05-02 10:28:08', '2019-05-02 10:28:08'),
	(581, 150, 820, '1315', '2019-05-01T10:36:00.000+12:00', '09:00', '13:00', '4 hrs', NULL, NULL, NULL, NULL, '<div>Refurbish machine.</div><div>Remove and washed boiler, washed all canisters and other parts, serviced all electrical parts, wipe the whole machine in/out, run program machine, check all drinks, tested machine, empty boiler and tank.</div><div>Remove side panels and done panel beating work on the machine body(twisted band bend) <br></div><div><br></div><div>Parts:</div><div>w seal - 2, w blade - 2, <br></div>', NULL, 1, 1, NULL, NULL, 1, NULL, 150, NULL, NULL, '2019-05-02 10:41:12', '2019-05-02 10:41:12'),
