	(607, 65, 857, '1314', '2019-05-06T09:24:00.000+12:00', '08:45', '09:30', '0:45', '45 mins', '20km', NULL, NULL, 'Drip tray half full. Emptied and tested with door open. All whipper bowls sealed correctly. Spoke with site. Students are pulling cup away on choc to get a stronger drink. Added a pause time to choc to discourage. Increased spring tension in the sensor probes. Fitted drip tray and filled. Machine goes out of order. Emptied and tested machine. Only a little clear water after choc dispenses. Entered info into Jware and audited the machine. Ordered replacement probe bracket for second machine on site.<div>Algeria 8-60. S/N:20134645802</div>', NULL, 1, 1, 1, 'Christine', 1, NULL, 65, NULL, NULL, '2019-05-06 09:31:44', '2019-05-06 09:31:44'),
