	(611, 150, 839, '1315', '2019-05-06T11:29:00.000+12:00', '10:15', '11:30', '75 minutes', NULL, NULL, NULL, NULL, '<div>Refurbish + Setup Machine.</div><div><br></div><div>Standard GOLD setup (New gold panel with label), coffee times 2.3 and 2.6<br></div><div><br></div><div>Refurbish</div><div>Open, wash and descale boiler, washed the whole machine( Machine too dirty, products inside machine), washed all canisters and other parts, serviced all electrical parts, wipe the whole machine in/out, removed glue from panel, replace top panel, Sanded and painted front panel of machine, run program machine, check all drinks, tested machine, empty boiler, machine ready.</div><div>Time : 5.25 hrs</div><div>Parts : w motor - 2, w seal - 1, w blade - 1, augar motor - 1, LL Spout - 2, RL spout - 1, <br></div>', NULL, 1, 1, NULL, NULL, 1, NULL, 150, NULL, NULL, '2019-05-06 11:38:55', '2019-05-06 11:38:55'),
